      "name": "Determinism",
      "relation": "uses",
      "entity_type": "concept",
      "wikipedia_url": "https://en.wikipedia.org/wiki/Determinism",
      "relevance": "The paper directly addresses the philosophical debate between determinism and free will, with Sapolsky arguing for determinism and Mitchell arguing against it."
    },
    {
      "name": "Neuroscience",
      "relation": "uses",
      "entity_type": "method",
      "wikipedia_url": "https://en.wikipedia.org/wiki/Neuroscience",
